script: |
  super -f text -I q1994.spq | sort > q1994.out

inputs:
  - name: q1994.spq
    data: |
      SELECT 67 + - ( + col2 ) AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + col0 BETWEEN + col1 + col2 AND + col2;
  - name: tab1

outputs:
  - name: q1994.out
    data: |
      -1
      -29
      8
